struct NameRegistry {
  NameType type;
  const char* typeName;
  const std::unordered_map<std::string, std::vector<std::string>>* map;
};

static const NameRegistry nameRegistries[] = {
    {NameType::AIModel_Comport,  "Comport",  &comportRulNames},
    {NameType::AIModel_Reflex,   "Reflex",   &comportRfxNames},
    {NameType::Family_State,   "State",   &stateNames},
    {NameType::Level_Sector,   "Sector",   &sectorNames},
};

std::string ToString(NameType type) {
  for (auto& r : nameRegistries)
    if (r.type == type)
      return r.typeName;
  return "Unknown";
}

NameType FromString(const std::string& str) {
  for (auto& r : nameRegistries)
    if (str == r.typeName)
      return r.type;
  throw std::invalid_argument("Unknown NameType: " + str);
}

static const std::unordered_map<std::string, std::vector<std::string>>*
GetMap(NameType type) {
  for (auto& r : nameRegistries)
    if (r.type == type)
      return r.map;
  throw std::invalid_argument("Unregistered NameType");
}

std::string NameFromIndex(NameType type, const std::string& container, int index) {
  static std::map<std::tuple<NameType, std::string, int>, std::string> cache;
  auto key = std::make_tuple(type, container, index);
  if (auto it = cache.find(key); it != cache.end())
    return it->second;

  const auto* map = GetMap(type);
  auto it = map->find(container);
  if (it != map->end() && index >= 0 && index < (int)it->second.size())
    return cache[key] = it->second[index];

  return cache[key] = ToString(type) + " #" + std::to_string(index);
}

int IndexFromName(NameType type, const std::string& container, const std::string& name) {
  static std::map<std::tuple<NameType, std::string, std::string>, int> cache;
  auto key = std::make_tuple(type, container, name);
  if (auto it = cache.find(key); it != cache.end())
    return it->second;

  const auto* map = GetMap(type);
  auto it = map->find(container);
  if (it != map->end()) {
    const auto& vec = it->second;
    for (size_t i = 0; i < vec.size(); ++i)
      if (vec[i] == name)
        return cache[key] = (int)i;
  }
  return cache[key] = -1;
}